import React from 'react';
import { Icon } from '@iconify/react';
import { Link } from 'react-router-dom';

const DeliveryDetails = () => {
  return (
    <div className="w-96 h-fit z-100 bg-white shadow-lg p-2 pt-6 ">
		  <div className="flex flex-col justify-center p-4 mt-1">
			<p className='text-dark-gray font-light text-sm'>Order List</p>
			<div className='w-full font-light text-dark-gray rounded mt-4 flex p-2 items-center justify-around border'>
				<div className='h-8 w-8 bg-light-gray rounded-lg'></div>
				<div className='flex flex-col'>
                    <span className='text-sm text-dark-gray'>Product 1</span>
                    <span className='text-sm text-dark-gray mt-2'>100.00</span>
                </div>
                <Icon icon="akar-icons:minus" color="#17181a" width="20" height="20" />
                <Icon icon="ion:star-outline" color="#17181a" width="20" height="20" />
			</div>
			<div className='font-light text-dark-gray rounded border mt-4 flex p-2 items-center justify-start gap-2'>
			    <Icon icon="fluent:call-16-regular" color="#17181A" width="24" height="24" />				
			    <span className='text-sm text-dark-gray'>9911921432</span>
			</div>
		  </div>
		</div>
  );
};

export default DeliveryDetails;
